import { Container } from "react-bootstrap";
import "../styles/css/Work.css";

const Work = () => {
  return (
    <>
      <Container className="work-main">
        <Container className="work-title">
          <h2>Work Experience</h2>
          <p></p>
        </Container>
      </Container>
    </>
  );
};
export default Work;
